const double M_2PI=2*M_PI;
template <class DataType> DataType wrap2pi(DataType x)
{
	x=x+M_PI;
	x=x - M_2PI * (int)(x /(M_2PI));

	if (x < 0) x+= M_2PI;
	return x-M_PI;
}
